The Autistic Gardener
You might have seen Alan Gardner exhibiting at the Chelsea Flower Show. You could hardly miss him with his shock of vermillion hair, tattoos and exquisitely painted fingernails. But he has an unusual take on life, too, because he has autism. He's taken on a bunch of five keen horticulturalists who are also on the autistic spectrum (or &quot;my weirdly wired protÃƒÂ©gÃƒÂ©s&quot; as he calls them) for this garden makeover show with a difference.
It's an intriguing experiment because some of his team can't cope with social situations, vocalise their thoughts or stay focused, while others get obsessed with details, straight lines or their own fixations. But, as Alan explains about the condition, &quot;When you connect with what stimulates you... you can unlock genius.&quot; 
The series is less about gardening and more about their unorthodox approach to it, but as you get to know the individuals, you start to see past their different traits and recognise their creative talents.


1)  Ashbourne Derbyshire 
Award-winning designer Alan Gardner assembles a team of fellow autistic horticultural enthusiasts to tackle a series of unruly gardens, beginning with Ben and Rebecca's overgrown wilderness in Ashbourne, Derbyshire. The couple are hoping for their plot to be transformed into a low-maintenance and fun garden for their family to enjoy, setting a stern test for Alan and his assistants Thomas, Charles, Philip, James and Victoria, on a time limit and a budget of Ã‚Â£3,000.

2)  West London 
Alan and his team of fellow autistic horticultural enthusiasts visit Ealing in West London, where they have taken on a small garden with a big problem. James and Sophie's neglected plot is only eight by four metres and is on two levels, with a one-metre drop. The challenge facing the team is to make the most of the limited space available so that the garden looks and feels bigger, with just one week to make the changes and a budget of Ã‚Â£1,200.

3)  South London 
Alan and his team take on their biggest garden yet, an overgrown 95-foot plot in South London owned by Zak and Eloise, with a Ã‚Â£10,000 budget to spend on the transformation. They have lived in the house with their two children for a year and have yet to tackle the garden. Alan and the gardeners are struck by the many sounds surrounding the space, from rustling leaves to passing trains, aircraft overhead and the crunchy gravel, so they decide to create a sound garden for the family - but will the clients understand what the ambitious gardeners are trying to achieve?

4)  North East London 
Award-winning designer Alan Gardner and his team of fellow autistic horticultural enthusiasts tackle another unruly garden, this time setting out to radically update a neglected plot for two twentysomethings, both named Alex, in North East London. Alan and the team decide to bring a sense of the modern and tropical to the 60ft by 20ft space and have a budget of just Ã‚Â£5,000 to complete their ambitious plans, but it won't stop raining - will the non-stop downpours scupper their plans?

